import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import Login from '../Login'
import Register from '../Register'
import './homepage.css'

export default class Homepage extends Component {
    render() {
        return (
            <div className='center'>
                <h1>Body Image</h1> 
                <div className='buttons'>

                    // when button is clicked, post a 'male' or 'female' status by user id to users table under the column 'gender' after account created
                    // there also should be a put request to update 'gender' in the users table if there is data already in the 'gender' column.  
                    <Link to='/male'><button>Male</button></Link>
                    <Link to='/female'><button>Female</button></Link>
                </div>

                <h4>Want to save your results?</h4>

                //post 'email' and 'password' to users table under the columns 'email' and 'password'
                <Register />

                //launch a get request to the users table that matches 'email' and 'password' with what the user typed in. Upon match users are brought to the input component displaying there last result along with there previous logs
                <Login />


            </div>


        )
    }
}
